import React from "react";
import "./Section5.css";
// import MediaQuery from 'react-responsive';
// import { Fragment } from "react";

const Section5 = () => {
  return (
    // <Fragment>
    // <MediaQuery minDeviceWidth={701}>
    <div id="rika" style={{paddingTop: '30px'}}>
      <section className="course">
        <h1 className="ddd">Sherbimet tona</h1>
        <div className="sxy">
          <div className="course-col">
            <h3>Soni</h3>
            <p>
              -Këshilla Ligjore. <br />
              -Hartimin e dokumentave të ndryshme ligjore; <br />
              -Hartimin dhe negocimin e kontratave te ndryshme <br />
              -Leje pune dhe leje qendrimi per shtetasit e huaj <br />
              -Likujdimin e shoqerise <br /> Hartimin e të gjitha dokumenteve të nevojshme për regjistrimin e
              biznesit në Shqipëri, përgatitjen e Rezolutës së Bordit të
              Drejtorëve, Prokurës dhe Dokumenteve të tjera të kërkuara për këtë
              qëllim;
            </p>
          </div>

          <div className="course-col">
            <h3>soni</h3>
            <p>
              Hartimin e të gjitha dokumenteve të nevojshme për regjistrimin e
              biznesit në Shqipëri, përgatitjen e Rezolutës së Bordit të
              Drejtorëve, Prokurës dhe Dokumenteve të tjera të kërkuara për këtë
              qëllim;               Hartimin e të gjitha dokumenteve të nevojshme për regjistrimin e
              biznesit në Shqipëri, përgatitjen e Rezolutës së Bordit të
              Drejtorëve, Prokurës dhe Dokumenteve të tjera të kërkuara për këtë
              qëllim;
            </p>
          </div>
          <div className="course-col">
            <h3>sonilA</h3>
            <p>
              -Hartimin e dokumentave të ndryshme ligjore; -Hartimin dhe
              negocimin e kontratave te ndryshme (shitjeje, qeraje, kontrata
              pune, kontratë shërbimi etj…), Ndryshime të Kontratave Ekzistuese;
              -Leje pune dhe leje qendrimi per shtetasit e huaj; -Likujdimin e
              shoqerise; -Shkresa te llojeve te ndryshme per ne administrate
              shteterore. - Çdo gjë që ka te beje ne çeshtjet e biznesit por nga
              ana ligjore.
            </p>
          </div>
        </div>
      </section>
      <div style={{ paddingTop: "95px" }}>
        {/* <hr
          style={{
            height: "1.5px",
            boxShadow: "4px 4px 5px rgb(123, 20, 163)",
          }}
        /> */}
      </div>
    </div>

    // </MediaQuery>
    // <MediaQuery>

    // </MediaQuery>
    // </Fragment>
  );
};

export default Section5;
